import React from 'react';
import logo from './images/Podnet1.png';
import './Sidebar.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button'

class SidebarContents extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: 'Tony Stark',
            password: 'IamIronMan'
        };

        this.handleChange = this.handleChange.bind(this);
    }

    handleChange(event) {
        this.setState({ value: event.target.value });
    }

    render() {
        return (
            <div className="container">
                <div classname="row">
                    <img src={logo} alt="logo" class="logo-opacity" />
                </div>
                <div classname="row">
                    <Form>
                        <Form.Group controlId="formBasicEmail">
                            <Form.Label>Email address: e.g. TonyStark@gmail.com</Form.Label>
                            <Form.Control type="email" placeholder="Enter email" />
                            <Form.Text className="text-muted">
                                We'll share your email with everyone else if you believe Tony Stark will use Gmail.
    </Form.Text>
                        </Form.Group>

                        <Form.Group controlId="formBasicPassword">
                            <Form.Label className={{fontcolor:"white"}}>Password</Form.Label>
                            <Form.Control type="password" placeholder="Password" />
                        </Form.Group>
                        <Form.Group controlId="formBasicCheckbox">
                            <Form.Check type="checkbox" label="Check me out" />
                        </Form.Group>
                        <Button variant="primary" type="submit">
                            Submit
  </Button>
                    </Form>
                </div>
            </div>
        )
    }
}

export default SidebarContents;
